import React from "react";
import Header from "components/Headers/Header.jsx";
import Step from "./examples/Step.jsx";
import Form from "./examples/Onboardform";

class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      page: "step"
    };
  }

  choose(value) {
    if (this.state.page === "step") {
      return <Step />;
    } else if (this.state.page === "form") {
      return <Form />;
    }
  }

  render() {
    return (
      <>
        <Header />
        {this.choose()}
      </>
    );
  }
}

export default Index;
